import React from 'react';

function Projects() {
    return (
        <>
            <h1>Projects:</h1>
            <p><a href ="https://github.com/yusuf3a50/portfolio/" target="_blank" rel="noopener noreferrer">
                The repository for this react web app is here
            </a></p>

            <p><a href="https://github.com/yusuf3a50/" target="_blank" rel="noopener noreferrer">
            I have more github repositories here</a></p>
            <p>   and also </p>

            <a href="https://github.com/sifr01/" target="_blank" rel="noopener noreferrer">here</a>.

            <p>

            I have a few more repos on my codepen profile  
             <a href="https://codepen.io/yusuf3a50/" target="_blank" rel="noopener noreferrer">here</a>
            </p>
        </>
    );
}

export default Projects;
